initializing.html.body:
Requiring
Now that everything is ready and installed you'll have to require the library like this :
const ModerationPubsub = require('twitch-moderation-pubsub');

let pubsub = new ModerationPubsub({
    token: '...',
    topics: ['...','...','...'],
    mod_id: '...'
});

// ... Event listeners and code


Token
token - {String} - is the OAuth token of your twitch account without the "oauth:" part. Like on the example below :  


Topics
topics - Array[{String}] - has to be an array of channel IDs. I strongly recommend that the first one is the ID of the account you're using.
Mod_id
mod_id - {String} - is the twitch ID of the account you're using to get the token.

methods.html.body:
Description
Fired when an user is banned from a channel.
Example
// ... Initializing

pubsub
    .on('ban', (data) => {
        console.log(data);
    });

Data
{
    channel_id: '41677043',
    type: 'ban',
    moderator: {
        id: '41677043',
        name: 'equinoxbug_'
    },
    target: {
        id: '136187141',
        name: 'iFonny'
    },
    reason: 'this is a test ban',
    duration: 'permanent',
    created_at: new Date().getTime()
}


channel_id - {String} - The id of the channel where the event happened.
type - {String} - The action that happened.
moderator - {Object} - The moderator that did the action.
moderator.id - {String} - The id of the moderator that did the action.
moderator.name - {String} - The username of the moderator that did the action.
target - {Object} - The user that is now banned.
target.id - {String} - The id of the user.
target.name - {String} - The name of the user.
reason - {String} - The reason of the timeout.
duration - {Number} - The duration of the timeout. Will always be 'permanent'.
created_at - {Number} - Timestamp of the creation of the action.

